const scrollObserver = new ScrollObserver();

// ----
// hero animation
// ----
scrollObserver.observe('.hero', {
    children: 'h1, img',
    onVisible: function(scrollInfos, percentRTW, percentRTE) {
        // title
        this.children[0].style.transform = 'translateY(' + percentRTE.y * 62 + 'vh)';
        this.children[0].style.opacity = 1 - percentRTE.y;
        // img
        this.children[1].style.transform = 'translateY(' + percentRTE.y * 15 + 'vh)';
        this.children[2].style.transform = 'translateY(' + percentRTE.y * -10 + 'vh)';
    }  
});

// ----
// figure animation
// ----
scrollObserver.observe('figure', {
   children: 'img',
   onVisible: function(scrollInfos, percentRTW, percentRTE) {
       const p = easings.easeInCubic(percentRTW.y) * -19.53;
       const s = 1.5 - Math.min(easings.easeOutCubic(percentRTW.y * 2) / 2, .5);
       this.children[0].style.transform = 'translateY(' + p + '%) scale(' + s + ')';
   }
});

// ----
// content paragraph & push
// ----
scrollObserver.observe('.content__text p, .push', {
    onVisible: function(scrollInfos, percentRTW, percentRTE) {
        const 
            el = this.element,
            isVisible = el.classList.contains('is-visible');
        
        if (!isVisible && percentRTW.y > .25) {
            el.classList.add('is-visible');
        } else if (isVisible && percentRTW.y === 0) {
            el.classList.remove('is-visible');
        }
    },
});

// ----
// content title
